// Import additional components for mapping
import React, { useState, useEffect } from 'react';
import './App.css';
import { Bar, Line, Pie, Doughnut } from 'react-chartjs-2';
import Papa from 'papaparse';
import {Chart as ChartJS,CategoryScale,LinearScale,PointElement,LineElement,BarElement,ArcElement,Title,Tooltip,Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,LinearScale,PointElement,LineElement,BarElement,ArcElement,Title,Tooltip,Legend
);

function App() {
  const [currentSection, setCurrentSection] = useState('dashboard');
  // Make sure chartData is properly initialized
  const [chartData, setChartData] = useState({
    vehicleData: { labels: [], datasets: [] },
    energyData: { labels: [], datasets: [] },
    stationData: { labels: [], datasets: [] },
    makeData: { labels: [], datasets: [] },
    usageData: { labels: [], datasets: [] },
    rangeData: { labels: [], datasets: [] }
  });
  const [isLoading, setIsLoading] = useState(true);
  const [dashboardMetrics, setDashboardMetrics] = useState({
    totalVehicleCount: 0,
    avgRange: 0,
    uniqueMakesCount: 0,
    bevCount: 0,
    phevCount: 0
  });

  useEffect(() => {
    const loadCSVData = async () => {
      try {
        const response = await fetch('/data-to-visualize/Electric_Vehicle_Population_Data.csv');
        if (!response.ok) {
          throw new Error(`Failed to fetch CSV: ${response.status} ${response.statusText}`);
        }
        const csvData = await response.text();
        console.log("CSV data loaded, first 100 chars:", csvData.substring(0, 100));
        
        Papa.parse(csvData, {
          header: true,
          complete: (results) => {
            console.log("Parsed data:", results.data.length, "rows");
            if (results.data.length > 0) {
              console.log("Sample row:", results.data[0]);
            }
            const data = results.data.filter(row => Object.keys(row).length > 1);
            processData(data);
          },
          error: (error) => {
            console.error('Error parsing CSV:', error);
            setIsLoading(false);
          }
        });
      } catch (error) {
        console.error('Error fetching CSV:', error);
        setIsLoading(false);
        generateMockData();
      }
    };
    

    
    const processData = (data) => {
      console.log("Processing", data.length, "rows of data");
      
      const vehiclesByYear = {};
      data.forEach(row => {
        const year = row['Model Year'];
        if (year && !isNaN(year)) {
          vehiclesByYear[year] = (vehiclesByYear[year] || 0) + 1;
        }
      });
      
      const sortedYears = Object.keys(vehiclesByYear).sort();
      const vehicleCounts = sortedYears.map(year => vehiclesByYear[year]);
      
      // Process electric range by year data
      const rangeByYear = {};
      let validRangeCount = 0;
      
      data.forEach(row => {
        const year = row['Model Year'];
        const range = parseFloat(row['Electric Range']);
        if (year && !isNaN(year) && !isNaN(range) && range > 0) {
          if (!rangeByYear[year]) {
            rangeByYear[year] = { total: 0, count: 0 };
          }
          rangeByYear[year].total += range;
          rangeByYear[year].count += 1;
          validRangeCount++;
        }
      });
      
      const avgRangeByYear = {};
      Object.keys(rangeByYear).forEach(year => {
        avgRangeByYear[year] = rangeByYear[year].total / rangeByYear[year].count;
      });
      
      const sortedRangeYears = Object.keys(avgRangeByYear).sort();
      const avgRangeCounts = sortedRangeYears.map(year => avgRangeByYear[year]);
      
      // Process CAFV eligibility data
      const eligibilityStatus = {
        eligible: 0,
        notEligible: 0,
        unknown: 0
      };
      
      data.forEach(row => {
        const status = row['Clean Alternative Fuel Vehicle (CAFV) Eligibility'];
        if (status && status.includes('Eligible')) {
          eligibilityStatus.eligible++;
        } else if (status && status.includes('Not eligible')) {
          eligibilityStatus.notEligible++;
        } else {
          eligibilityStatus.unknown++;
        }
      });
      
      // Process geographic distribution data
      const vehiclesByCity = {};
      data.forEach(row => {
        const city = row['City'];
        if (city) {
          vehiclesByCity[city] = (vehiclesByCity[city] || 0) + 1;
        }
      });
      
      const topCities = Object.keys(vehiclesByCity)
        .sort((a, b) => vehiclesByCity[b] - vehiclesByCity[a])
        .slice(0, 10);
      
      const cityData = topCities.map(city => vehiclesByCity[city]);
      
      const vehiclesByCounty = {};
      data.forEach(row => {
        const county = row['County'];
        if (county) {
          vehiclesByCounty[county] = (vehiclesByCounty[county] || 0) + 1;
        }
      });
      
      const topCounties = Object.keys(vehiclesByCounty)
        .sort((a, b) => vehiclesByCounty[b] - vehiclesByCounty[a])
        .slice(0, 5);
      
      const countyData = topCounties.map(county => vehiclesByCounty[county]);
      
      const vehiclesByType = {};
      data.forEach(row => {
        const type = row['Electric Vehicle Type'];
        if (type) {
          vehiclesByType[type] = (vehiclesByType[type] || 0) + 1;
        }
      });
      
      const vehicleTypes = Object.keys(vehiclesByType);
      const typeCounts = vehicleTypes.map(type => vehiclesByType[type]);
      
      const vehiclesByMake = {};
      data.forEach(row => {
        const make = row['Make'];
        if (make) {
          vehiclesByMake[make] = (vehiclesByMake[make] || 0) + 1;
        }
      });
      
      const topMakes = Object.keys(vehiclesByMake)
        .sort((a, b) => vehiclesByMake[b] - vehiclesByMake[a])
        .slice(0, 5);
      
      const makeData = topMakes.map(make => vehiclesByMake[make]);
      
      const totalVehicleCount = data.length;
      
      let totalRange = 0;
      let rangeCount = 0;
      data.forEach(row => {
        const range = parseFloat(row['Electric Range']);
        if (!isNaN(range) && range > 0) {
          totalRange += range;
          rangeCount++;
        }
      });
      const avgRange = rangeCount > 0 ? Math.round(totalRange / rangeCount) : 0;
      
      const uniqueMakes = new Set();
      data.forEach(row => {
        if (row['Make']) {
          uniqueMakes.add(row['Make']);
        }
      });
      
      let bevCount = 0;
      let phevCount = 0;
      data.forEach(row => {
        if (row['Electric Vehicle Type'] && row['Electric Vehicle Type'].includes('BEV')) {
          bevCount++;
        } else if (row['Electric Vehicle Type'] && row['Electric Vehicle Type'].includes('PHEV')) {
          phevCount++;
        }
      });
      
      setDashboardMetrics({
        totalVehicleCount,
        avgRange,
        uniqueMakesCount: uniqueMakes.size,
        bevCount,
        phevCount
      });
      
      setChartData({
        vehicleData: {
          labels: sortedYears,
          datasets: [{
            label: 'Vehicles by Model Year',
            data: vehicleCounts,
            backgroundColor: 'rgba(54, 162, 235, 0.5)',
            borderColor: 'rgb(54, 162, 235)',
            borderWidth: 1
          }]
        },
        energyData: {
          labels: sortedRangeYears,
          datasets: [{
            label: 'Average Electric Range (miles)',
            data: avgRangeCounts,
            backgroundColor: 'rgba(255, 99, 132, 0.2)',
            borderColor: 'rgb(255, 99, 132)',
            borderWidth: 2,
            tension: 0.3,
            fill: true
          }]
        },
        stationData: {
          labels: topCounties,
          datasets: [{
            label: 'Vehicles by County',
            data: countyData,
            backgroundColor: [
              'rgba(255, 99, 132, 0.6)',
              'rgba(54, 162, 235, 0.6)',
              'rgba(255, 206, 86, 0.6)',
              'rgba(75, 192, 192, 0.6)',
              'rgba(153, 102, 255, 0.6)',
            ],
            borderColor: [
              'rgb(255, 99, 132)',
              'rgb(54, 162, 235)',
              'rgb(255, 206, 86)',
              'rgb(75, 192, 192)',
              'rgb(153, 102, 255)',
            ],
            borderWidth: 1
          }]
        },
        makeData: {
          labels: topMakes,
          datasets: [{
            label: 'Vehicles by Manufacturer',
            data: makeData,
            backgroundColor: [
              'rgba(153, 102, 255, 0.6)',
              'rgba(255, 159, 64, 0.6)',
              'rgba(75, 192, 192, 0.6)',
              'rgba(255, 206, 86, 0.6)',
              'rgba(54, 162, 235, 0.6)',
            ],
            borderColor: [
              'rgb(153, 102, 255)',
              'rgb(255, 159, 64)',
              'rgb(75, 192, 192)',
              'rgb(255, 206, 86)',
              'rgb(54, 162, 235)',
            ],
            borderWidth: 1
          }]
        },
        usageData: {
          labels: vehicleTypes,
          datasets: [{
            label: 'Vehicles by Type',
            data: typeCounts,
            backgroundColor: 'rgba(75, 192, 192, 0.5)',
            borderColor: 'rgb(75, 192, 192)',
            borderWidth: 1
          }]
        }
      });
      
      setIsLoading(false);
    };
    
    // In your useEffect or data loading function, add console logs to debug
    useEffect(() => {
      const loadCSVData = async () => {
        try {
          const response = await fetch('/data/Electric_Vehicle_Population_Data.csv');
          const csvText = await response.text();
          console.log("CSV loaded successfully");
          
          Papa.parse(csvText, {
            header: true,
            complete: (results) => {
              console.log("CSV parsing complete", results.data.length);
              // Process data as normal
              processData(results.data);
            },
            error: (error) => {
              console.error("CSV parsing error:", error);
              setIsLoading(false);
            }
          });
        } catch (error) {
          console.error("Error loading CSV:", error);
          setIsLoading(false);
        }
      };
      
      loadCSVData();
    }, []);
  }, []);

  const barOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Vehicle Registration by Year',
      },
    },
  };

  const lineOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Average Electric Range by Year',
      },
    },
  };
  
  const pieOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'right',
      },
      title: {
        display: true,
        text: 'Vehicle Distribution by County',
      },
    },
  };

  const doughnutOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'right',
      },
      title: {
        display: true,
        text: 'Top 5 Vehicle Manufacturers',
      },
    },
  };

  const hourlyOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Vehicles by Type',
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        title: {
          display: true,
          text: 'Count'
        }
      },
      x: {
        title: {
          display: true,
          text: 'Vehicle Type'
        }
      }
    }
  };

  const rangeOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Vehicle Distribution by Electric Range',
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        title: {
          display: true,
          text: 'Number of Vehicles'
        }
      },
      x: {
        title: {
          display: true,
          text: 'Range (miles)'
        }
      }
    }
  };

  return (
    <div className="App">
      <nav className="navbar">
        <div className="navbar-brand">
          <h1>EV Analytics Dashboard</h1>
        </div>
        
        <ul className="navbar-links">
          <li><a href="#dashboard" onClick={() => setCurrentSection('dashboard')} className={currentSection === 'dashboard' ? 'active' : ''}>Dashboard</a></li>
          <li><a href="#analytics" onClick={() => setCurrentSection('analytics')} className={currentSection === 'analytics' ? 'active' : ''}>Analytics</a></li>
          <li><a href="#reports" onClick={() => setCurrentSection('reports')} className={currentSection === 'reports' ? 'active' : ''}>Reports</a></li>
          <li><a href="#settings" onClick={() => setCurrentSection('settings')} className={currentSection === 'settings' ? 'active' : ''}>Settings</a></li>
        </ul>
      </nav>
      
      <main className="content">
        <section id="dashboard" className="dashboard-container">
          <h2>EV Analytics Overview</h2>
          
          {isLoading ? (
            <div className="loading-spinner">Loading data...</div>
          ) : (
            <>
              <div className="dashboard-grid">
                <div className="dashboard-card">
                  <h3>Total Vehicles</h3>
                  <p className="metric">{dashboardMetrics.totalVehicleCount.toLocaleString()}</p>
                  <p className="trend positive">From {dashboardMetrics.totalVehicleCount} records</p>
                </div>
                <div className="dashboard-card">
                  <h3>Average Electric Range</h3>
                  <p className="metric">{dashboardMetrics.avgRange} miles</p>
                  <p className="trend neutral">Based on available data</p>
                </div>
                <div className="dashboard-card">
                  <h3>Unique Manufacturers</h3>
                  <p className="metric">{dashboardMetrics.uniqueMakesCount}</p>
                  <p className="trend positive">Different EV makers</p>
                </div>
                <div className="dashboard-card">
                  <h3>BEV vs PHEV Ratio</h3>
                  <p className="metric">
                    {Math.round((dashboardMetrics.bevCount / (dashboardMetrics.bevCount + dashboardMetrics.phevCount)) * 100)}%
                  </p>
                  <p className="trend neutral">{dashboardMetrics.bevCount} BEVs, {dashboardMetrics.phevCount} PHEVs</p>
                </div>
              </div>
              <div className="charts-container">
                <div className="chart-row">
                  <div className="chart-wrapper half-width">
                    <Bar data={chartData.vehicleData} options={barOptions} />
                    <p className="chart-description">Vehicle registrations by model year show the growth trend of electric vehicles over time, with newer models becoming increasingly popular.</p>
                  </div>
                  <div className="chart-wrapper half-width">
                    <Line data={chartData.energyData} options={lineOptions} />
                    <p className="chart-description">Average electric range has been steadily increasing over the years, demonstrating improvements in battery technology and addressing range anxiety concerns.</p>
                  </div>
                </div>
                <div className="chart-row">
                  <div className="chart-wrapper small-chart">
                    <Pie data={chartData.stationData} options={{...pieOptions, maintainAspectRatio: true}} />
                    <p className="chart-description">Distribution of electric vehicles across top counties in Washington state, showing regional adoption patterns.</p>
                  </div>
                  <div className="chart-wrapper small-chart">
                    <Doughnut data={chartData.makeData} options={{...doughnutOptions, maintainAspectRatio: true}} />
                    <p className="chart-description">Market share of the top 5 electric vehicle manufacturers, highlighting industry leaders.</p>
                  </div>
                </div>
               
                <div className="chart-wrapper">
                  <Bar data={chartData.usageData} options={hourlyOptions} />
                  <p className="chart-description">This chart shows the distribution of electric vehicles by type (BEV vs PHEV), highlighting the market share of fully electric versus hybrid vehicles.</p>
                </div>
                
                <div className="chart-wrapper vehicle-type-chart">
                  <Bar data={chartData.rangeData} options={rangeOptions} />
                  <p className="chart-description">Distribution of electric vehicles by their electric range capability, showing the most common range categories in the dataset.</p>
                </div>
               
               
              </div>
            </>
          )}
        </section>
      </main>
      
      <footer className="footer">
        <div className="footer-content">
          <p> 2025 EV Analytics Dashboard. All rights reserved.</p>
          <div className="footer-links">
            <a href="#privacy">Privacy Policy</a>
            <a href="#terms">Terms of Service</a>
            <a href="#contact">Contact</a>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default App;
